description:
The Football League Show 19.10.2013

Duration: 1 hour, 15 min

Manish Bhasin presents the best of the action from all three divisions of the Football League. Former England manager Steve McClaren has enjoyed a flying start at Derby County. This week his improving young side meet Gianfranco Zola's free-scoring Watford at Vicarage Road. Plus extended highlights from Bloomfield Road as Blackpool, without a win in five, go head-to-head with Owen Coyle's Wigan.
